import logo from './logo.svg';
import './App.css';

function Title() {
  function getInitialState(){
    return {hover: false}
  }

  function toggleHover(){
    this.setState({hover: !this.state.hover})
  }

  return(
    <div className="isolate titles">
      <a href="index.html" id="title" className="title rainbow red">JackSavini.com</a>
      <a href="index.html" id="title" className="title rainbow blue">JackSavini.com</a>
      <a href="index.html" id="title" className="title rainbow green">JackSavini.com</a>
    </div>
  )
}

var Link = react.createClass({
  getInitialState: function(){
    return {hover: false}
  },
  toggleHover: function(){
    this.setState({hover: !this.state.hover})
  },
  render: function() {
    var linkStyle;
    if (this.state.hover) {
      linkStyle = {backgroundColor: 'red'}
    } else {
      linkStyle = {backgroundColor: 'blue'}
    }
    return(
      <div>
        <a style={linkStyle} onMouseEnter={this.toggleHover} onMouseLeave={this.toggleHover}>Link</a>
      </div>
    )
  }
})

function App() {
  return (
    <Title/>
  );
}

export default App;
